import { useDispatch, useSelector } from 'react-redux'
import { likeList, likeProduct, removeLike } from '../store/actions/likeProducts'
import Header from '../components/Header'
import Footer from '../components/Footer'
import AddShoppingCartIcon from '@mui/icons-material/AddShoppingCart';
import React, { useCallback, useEffect, useState } from 'react'
import Spinner from 'react-bootstrap/Spinner';
import { toast} from 'react-toastify';
import { useNavigate } from 'react-router-dom'
import { basketCreate, basketList } from '../store/actions/basket';
import ThumbDownSharpIcon from '@mui/icons-material/ThumbDownSharp';
import Toast from '../components/Toast';

export default function LikeProducts() {


  const [load, setLoad] = useState(true)
  const likes = useSelector((state) => state.likes.likes)
  const dispatch = useDispatch()
  const navigate = useNavigate()
  const token = localStorage.getItem("userToken")
  const userData = JSON.parse(localStorage.getItem("userData"))
  const likeId = useSelector((state) => state.likes.likeId)


console.log(likeId)

  console.log(likes)

  useEffect(() => {
    (async () => {
      setLoad(true)
      await dispatch(likeList())
      setLoad(false)
    })()

  }, [likeList])


  const handleClick = useCallback(async(el) => {

    if(!userData){
      toast.error('Please login to be add card!', {
          position: "top-center",
          autoClose: 1000,
          hideProgressBar: false,
          closeOnClick: true,
          pauseOnHover: true,
          draggable: true,
          progress: undefined,
          theme: "dark",
      });
      return
  }

    const data = await dispatch(basketCreate({          
      user_id: userData.id,
      product_id: el.product.id,
      quantity: el.product.quantity,
      price: el.product.price
  }))

  if (data.payload) {
    toast.success(`${el.product.title} added in your basket`, {
      position: "top-center",
      autoClose: 1000,
      hideProgressBar: false,
      closeOnClick: true,
      pauseOnHover: true,
      draggable: true,
      progress: undefined,
      theme: "dark",
      });
}

if (!data.payload) {
    toast.error('Item already in cart!', {
        position: "top-center",
        autoClose: 1000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: undefined,
        theme: "dark",
    });
    return
}


await dispatch(basketList())
  }, [])


  const singleItem = useCallback((item) => {
    navigate(`/home/${item.id}`)
  }, [])

  const handleDisLike = useCallback(async(el) => {
await dispatch(removeLike(el))
await dispatch(likeList())
  }, [])


  return (

    <>
    <Toast/>
      <Header />

      {token && userData.id ?   
      <>
      {!load ?
        <div>
          {likes.length ?
            <div className='cardStyle'>
              {likes.map((item) => (
                <div key={item.product.id} className='productsDiv'>
                  <div onClick={() => singleItem(item.product)} className="card ">
                    <img className="card-img-top" src={item.product.image} alt="Card image cap" />
                    <div className="card-body">
                      <h5 className="card-title">{item.product.title}</h5>
                      <p className="card-text desc">{item.product.description}</p>
                      <p className="card-text">{item.product.price + '$'}</p>
                      <p className="card-text">
                        {item.product.quantity}
                      </p>
                    </div>
                  </div>
                  <div className='btnChange'>
                  <button onClick={() => handleClick(item)}><AddShoppingCartIcon style={{ fontSize: 35 }} /></button>
                  <button onClick={() => handleDisLike(item.id)}><ThumbDownSharpIcon style={{ fontSize: 35 }} /></button>
</div>
                </div>
              ))
              }
            </div>
            :
            <h2>Likes is Empty</h2>
          }
        </div>

        :
        <div className='spL'>
          <Spinner className='spinnerLoad' animation="border" variant="dark" />

        </div>
      }
      </>
      :
      <h2>Your wishlist items is empty</h2>
}
      <Footer />

    </>



  )
}
